import "./TodoList.css";

const Todo = (props) => {
    return (
        <div className="todo">
            { props.todoList.map((todo, index) => {
                return (
                    <div className="task" key={ index }>
                        <input type="checkbox" />
                        <li> { todo } </li>
                    </div>
                )
            }) }
        </div>
    );
}

export default Todo;
